{
  "Version": "2012-10-17",
  "Statement": [
    {
      "Sid": "Enable IAM User Permissions",
      "Effect": "Allow",
      "Action": "kms:*",
      "Resource": "*",
      "Principal": {
        "AWS": "arn:aws:iam::335561046948:root"
      }
    },
    {
      "Sid": "Allow IAM Role to use key",
      "Effect": "Allow",
      "Action": [
        "kms:ReEncrypt*",
        "kms:List*",
        "kms:GenerateDataKey*",
        "kms:Encrypt",
        "kms:DescribeKey",
        "kms:Decrypt",
        "kms:CreateGrant"
      ],
      "Resource": "*",
      "Principal": {
        "AWS": [
          "arn:aws:iam::335561046948:role/master-devcluster",
          "arn:aws:iam::335561046948:role/dev-d3fbcac0139a-s3-replication-role",
          "arn:aws:iam::335561046948:role/dev-d3fbcac0139a-main"
        ]
      }
    }
  ]
}
